import React from 'react'

const TodoList = ({todos, setTodos}) => {
  return (
    <div>
         <ul className="todo-list">
            {todos.map((task) => (
                <div className="todoText">
                    <span>{task.text}</span>
                </div>
            ))}
         </ul>
    </div>
  )
}

export default TodoList
